import "./header.scss";
import * as Icons from "../icons/index";

function Header() {
  return (
    <header>
      <div className="container">
        <div className="container-inner">
          <div className="header-left"></div>
          <div className="header-right"></div>
        </div>
      </div>
    </header>
  );
}

export default Header;
